public class VendorSubclient {
    private String clientname;
    private String subprocessname;
    private String subprocesscode;
    private String state;
    private String county;
    private String invoicename;
    private String subId;
    private String address;


    public String getClientname() {
        return clientname;
    }

    public void setClientname(String clientname) {
        this.clientname = clientname;
    }

    public String getSubprocessname() {return subprocessname;
    }

    public void setSubprocessname(String subprocessname) {
        this.subprocessname = subprocessname;
    }

    public String getSubprocesscode() {
        return subprocesscode;
    }

    public void setSubprocesscode(String subprocesscode) {
        this.subprocesscode = subprocesscode;
    }

    public String getState() {
        return state;
    }

    public void setState(String state) {
        this.state = state;
    }

    public String getCounty() {
        return county;
    }

    public void setCounty(String county) {
        this.county = county;
    }

    public String getInvoicename() {
        return invoicename;
    }

    public void setInvoicename(String invoicename) {
        this.invoicename = invoicename;
    }

    public String getSubId() {
        return subId;
    }

    public void setSubId(String subId) {
        this.subId = subId;
    }

    public String getAddress() {
        return address;
    }

    public void setAddress(String address) {
        this.address = address;
    }
}


